import hamburger from "../icons/hamburger.svg"
import { Link } from "react-router-dom";
import { useState } from "react";
const Nav = () => {
  const [mobileOpen, setMobileOpen] = useState(false)
  const navLinks = [
    { href: "/home", label: "Home" },
    { href: "/team", label: "Meet the Team" },
    { href: "/contact", label: "Contact" },
  ]
  return (
    <header className='padding-x py-8 absolute z-10 w-full'>
      <nav className='flex justify-between items-center max-container'>
        <a href='/'>
          <h1 className="italic text-xl text-purple-700 font-semibold font-montserrat">&gt;SheCan MN</h1>
        </a>
        <ul className='flex-1 flex justify-end items-center gap-8 max-lg:hidden'>
          {navLinks.map((item) => (
            <Link to={item.href}>
              <li key={item.label}>
                <h1
                  className='font-montserrat leading-normal text-lg text-purple-700 font-semibold'
                >
                  {item.label}
                </h1>
              </li>
            </Link>
          ))}
        </ul>

        <div className='hidden max-lg:block'>
          <img src={hamburger} alt='hamburger icon' width={25} height={25} />
        </div>

        <Popover.Group className="hidden lg:flex lg:gap-x-12">
          <Popover className="relative">
            <Popover.Button className="flex items-center gap-x-1 text-sm font-semibold leading-6 text-gray-900">
              About
              <ChevronDownIcon className="h-5 w-5 flex-none text-gray-400" aria-hidden="true" />
            </Popover.Button>

            <Transition
              as={Fragment}
              enter="transition ease-out duration-200"
              enterFrom="opacity-0 translate-y-1"
              enterTo="opacity-100 translate-y-0"
              leave="transition ease-in duration-150"
              leaveFrom="opacity-100 translate-y-0"
              leaveTo="opacity-0 translate-y-1"
            >

              <Popover.Panel className="absolute -left-8 top-full z-10 mt-3 w-screen max-w-md overflow-hidden rounded-3xl bg-white shadow-lg ring-1 ring-gray-900/5">
                <div className="p-4">
                  {products.map((item) => (
                    <div
                      key={item.name}
                      className="group relative flex items-center gap-x-6 rounded-lg p-4 text-sm leading-6 hover:bg-gray-50"
                    >
                      <div className="flex h-11 w-11 flex-none items-center justify-center rounded-lg bg-gray-50 group-hover:bg-white">
                        <item.icon className="h-6 w-6 text-gray-600 group-hover:text-indigo-600" aria-hidden="true" />
                      </div>



                      {
                        item.name === "FIRST" ? <a href={item.route}>
                          <div className="flex-auto">
                            <a href={item.route} key={item.name} className="block font-semibold text-gray-900">
                              {item.name}
                              <span className="absolute inset-0" />
                            </a>
                            <p className="mt-1 text-gray-600">{item.description}</p>
                          </div>
                        </a> : <Link to={item.route}>
                          <div className="flex-auto">
                            <a href={item.href} key={item.name} className="block font-semibold text-gray-900">
                              {item.name}
                              <span className="absolute inset-0" />
                            </a>
                            <p className="mt-1 text-gray-600">{item.description}</p>
                          </div>
                        </Link>
                      }

                    </div>
                  ))}
                </div>
                <div className="grid grid-cols-2 divide-x divide-gray-900/5 bg-gray-50">
                  {/* {callsToAction.map((item) => (
                    <a
                      key={item.name}
                      href={item.href}
                      className="flex items-center justify-center gap-x-2.5 p-3 text-sm font-semibold leading-6 text-gray-900 hover:bg-gray-100"
                    >
                      <item.icon className="h-5 w-5 flex-none text-gray-400" aria-hidden="true" />
                      {item.name}
                    </a>
                  ))} */}
                </div>
              </Popover.Panel>
            </Transition>
          </Popover>

          {
            navLinks.map((page) => {
              return (
                <a key={page.title} href="#" className="text-sm font-semibold leading-6 text-gray-900">
                  <Link to={`/${title.toLowerCase()}`}>{page.label}</Link>
                </a>
              );
            })
          }

        </Popover.Group>















      </nav>
    </header>
  );
};

export default Nav;
